export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},EfFaXB1Gw0:{data:{id:606,attributes:{imdbId:"tt0085333",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZThhNDQxNzAtOTYzZC00MzZkLWI2YjItOTE2ZjliZDY3NTFkXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.7\u002F10"},{Source:"Rotten Tomatoes",Value:"69%"},{Source:"Metacritic",Value:"57\u002F100"}],item_lang:{data:{id:1269,attributes:{title:c,plot:"In 1957, in Detroit, a red Plymouth Fury is built and is the cause of two accidents, one of them fatal, still in the assembly line. Twenty-one years later, the outcast and bullied nerd Arnold \"Arnie\" Cunningham is getting a ride with his best and only friend Dennis Guilder and he sees the wrecked car for sale in a garden. Arnie immediately falls in love with the car. The car was given the name Christine by its first owner. He brings the car to a repair shop of the despicable Will Darnell and works hard to restore the classic car. While he works in the restoration, he changes his personality to a cocky teenager and he dates the most beautiful girl in the high-school, Leigh Cabot. Soon Arnie becomes selfish and jealous of the supernatural Christine that kills everyone that is a threat to them.",slug:"christine"}}},books:{data:[{id:4206,attributes:{title:c,description:"Stephen King's tale of a possessed 1958 Plymouth Fury. Arnie buys an old Plymouth that has mystical powers to possess and destroy. She purrs like a kitten ... but watch out when she roars.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Has5DAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"2016-05-31",publisher:"Simon and Schuster",subtitle:d}},{id:4207,attributes:{title:c,description:"Ein Meisterwerk der modernen Horrorliteratur Eine verhängnisvolle Dreiecksbeziehung: Arnie liebt seine Freundin Leigh und \"Christine\", seinen 1958er Plymouth Fury. Aber das Auto lebt. Und es ist tödlich eifersüchtig. Verfilmt von Starregisseur John Carpenter.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=wNG2PESedzQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:"2011-02-18",publisher:"Heyne Verlag",subtitle:"Roman"}},{id:4208,attributes:{title:c,description:"Arnie Cunningham is in love with his car. Christine, the car, is in complete control. \"Vintage King . . . breathtaking, awesome. Carries such momentum the reader must force himself to slow down.\"--\"New York Times Book Review\" Copyright © Libri GmbH. All rights reserved.",thumbnail:d,authors:[a],firstBook:e,published:"1992-01-01",publisher:d,subtitle:d}},{id:4209,attributes:{title:"The Likeness of the King",description:"Anyone who has strolled through the halls of a museum knows that portraits occupy a central place in the history of art. But did portraits, as such, exist in the medieval era? Stephen Perkinson's \"The likeness of the king\" challenges the canonical account of the invention of modern portrait practices, offering a case against the tendency of recent scholarship to identify likenesses of historical personages as \"the first modern portraits\". Focusing on the Valois court of France, he argues that local practice prompted shifts in the late medieval understanding of how images could represent individuals and prompted artists and patrons to deploy likeness in a variety of ways.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=V0dQAXvk32MC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Stephen Perkinson"],firstBook:e,published:"2009-10-15",publisher:"University of Chicago Press",subtitle:"A Prehistory of Portraiture in Late Medieval France"}},{id:4210,attributes:{title:a,description:"Titles include \"Christine, The Shining\" and \"Cujo\".",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=py1rAAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:e,published:"1995-09-15",publisher:"New Amer Library",subtitle:"Christine, the Shining, Cujo"}}]}}},meta:{}}},prerenderedAt:1681377253240}}("Stephen King","movie","Christine","",null,"series",1))